sintesis:
Actividad híbrida (Presencial / zoom). Diálogo abierto sobre “Infraestructuras para la Integración” a cargo de los Ministros participantes:
Tarcisio Gomes de Freitas, Ministro de Infraestructura (Brasil); 
Arnoldo Wiens Durksen, Ministro de Obras Públicas y Comunicaciones (Paraguay);  
Juan José Olaizola, Ministro Interino de Transporte y Obras Públicas (Uruguay); 
Edgar Montaño Rojas, Ministro de Obras Públicas, Servicios y Vivienda(Bolivia); 
Alfredo Moreno Charme, Ministro de Obras Públicas / Gloria Hutt, Ministra de Transportes y Telecomunicaciones (Chile);  
Ángela María Orozco Gómez, Ministra de Transporte (Colombia);
Marcelo Cabrera Palacios, Ministro de Obras Públicas (Ecuador);
Juan Edghill, Ministro de Obras Públicas (Guyana);  
Eduardo González Chávez, Ministro de Transporte y Comunica (Perú).
